// Build one message from all Split Out items
const items = $input.all().map(i => i.json);
const lines = items.map(e =>
  `${e.Date} ‚Äî ${e.Category} $${Number(e.Amount).toFixed(2)}${e.Merchant ? ' ('+e.Merchant+')' : ''}`
);
const count = items.length;
return [{
  json: {
    text: `Just tracked ${count} expense${count!==1?'s':''}:\n` + lines.join('\n')
  }
}];
